const header = {
  // all the properties are optional - can be left empty or deleted
  homepage: 'https://rjshkhr.github.io/cleanfolio',
  title: 'J.H',
}

const about = {
  // all the properties are optional - can be left empty or deleted
  name: '안녕하세요 송정헌 목사 입니다',

  description:
