const projects = [
  '광주송원고등학교 졸업 (1986)',
  '서울대학교 사회복지학과 졸업 (1991)',
  '서울대학교 대학원 사회복지학과 수료 (1993)',
  '총신대학교 신학대학원 졸업 (1996)',
]

const skills = [
  '초등부 교육전도사(서울 승동교회)',
  '목사 임직(북전주노회)',
  '서울대학교 대학원 사회복지학과 수료 (1993)',
  '총신대학교 신학대학원 졸업 (1996)',
]

const contact = {
  // email is optional - if left empty Contact section won't show up
